import * as api from "../helpers/Api";
import store from "../index";
// action Creators
export const getTeams = () => async (dispatch) => {
  try {
    const data = await api.fetchTeams(store.getState().token);
    console.log(data, "Teeeeeeeeeeeeeeams");
    dispatch({ type: "FETCH_ALL", payload: data });
  } catch (err) {
    console.log(err);
  }
};
